#Example:

from string import maketrans   # Required to call maketrans function.

intab = "ABCDEFGHIJKLMNOPQRSTUVWXYZ"
outtab = "CDEFGHIJKLMNOPQRSTUVWXYZ"

intab = intab.lower()
outtab = outtab.lower()

trantab = str.maketrans(intab, outtab)

str = 'map html'
print(str.translate(trantab))


